import React, {Component} from 'react';
import './about.scss'

class About extends Component{
    constructor(props){
        super(props)
        this.setState={
            Hello:''
        }
    }

    render(){
        return(
            <React.Fragment>

                <h4>About Me!</h4>
            </React.Fragment>
        )
    }
}

export default About
